import  React from 'react'
import {
    Link,
    useRouteMatch
  } from "react-router-dom";

function Nav(){
    let { url } = useRouteMatch();
    return(
        <nav>
        <Link to={`${url}application/info`}><button >Info</button><br/></Link>
        <Link to={`${url}application/toodos`}><button>Toodos</button><br/></Link>
        <Link to={`${url}application/posts`}><button>Posts</button><br/></Link>
        <Link to={`${url}application/albums`}><button>Albums</button><br/></Link>
        </nav>
    )
}
export default Nav;
